.navMenu {
  .navMenuList{
    li{
      position: relative;
      cursor: pointer;
      transition: all 0.5s;
      i {
        position: absolute;
        width: 16px;
        text-align: center;
        height: 18px;
        line-height: 18px;
        left: 20px;
      }
      span{
        font-family: PingFangSC-Regular;
        font-size: 14px;
        letter-spacing: 0;
        line-height: 16px;
        margin-left: 49px;
      }
      b {
        width: 3px;
        position: absolute;
        top: 0;
        left: 0;
      }
    }
    .listActive {
      box-sizing: border-box;
      position: relative;
    }
  }
}
// 国际版
.Int {
  .navMenu {
  .navMenuList{
    li{
      border-bottom-width: 1px;
      border-bottom-style: solid;
      b.activeBorder {
        display: none;
      }
    }
  }
}
}
